import React from 'react';
import "./App.css";


function Btn({name}){

const btnStyle = {
  width: "37px",
  height: "15px",
  overflow: "visible",
  color: "#000000",
  fontSize: "14px",
  fontFamily: "Inter",
  letterSpacing: "0px",
  lineHeight: "1.1",
  border:0,
  backGroud:"#ffffff"
}
  function ClickMe(){
   console.log({name});
  }
  return <button style={btnStyle} onClick = {ClickMe}>
    {name}
  </button>
}

function LeftArea () {
  return (
    <div className = "left-area">
      <div className = "desin_system">
        Design
        System
        for ITRM
      </div>
      <div className = "style_guide">
        STYLE GUIDE
      </div>
      <div className = "style_guide_elements">
        <Btn name = "Color">Color</Btn>
        Typography
        Icon
        Logo
      </div>
      <div className = "ui_component">
        UI Component
      </div>
      <div className = "ui_component_elements">
        Buttons
        Toggles
        Input Fields
        Dropdown Menus
        ToolTips & Markers
        Notifications
        Modals
        Empty States
        Date Pickers
        Grid List
        Data Tables
      </div>
    </div>
  );
}

function Contents(){
  return <div className = "content-area">
    ready to put somethings....
    </div>;
}

function App() {
  return(
      <div>
        <LeftArea />
        <Contents />
      </div>
    );
}

export default App;
